import React from "react";
import { UnlockOutlined , UserOutlined ,CameraOutlined ,CheckOutlined} from '@ant-design/icons';

import { Steps } from "antd";

const Stepper_code = () => (
    <Steps className="stepper"
    current={0}
      items={[
        {
          title: 'Account info',
        
          icon: <UnlockOutlined  />,
        },
        {
          title: 'personal Info',
          
          icon: <UserOutlined  />,
        },
        {
          title: 'Images',
         icon: <CameraOutlined />
        
        },
        {
          title: 'finish',

          icon: <CheckOutlined />
        },
      ]}
    />
  );
  export default Stepper_code;
